import React from "react";
import Task from "../components/task";

const allTasks = ({ tasks }) => {
  return (
    <div>
      <Task task={{ id: 1, description: "Hello" }} />
      {tasks.map((task) => (
        <Task task={task} />
      ))}
    </div>
  );
};

export default allTasks;
